import React from 'react';

class ImageLazyLoad extends React.Component{
    constructor(props){
        super(props)
        this.onload=this.onload.bind(this);
        var t=this;
    }
    onload (){
        var defaultImage=this.props.defaultImage;
        setTimeout(()=>{
            return (
                <img src={defaultImage} alt=''  />
            )
        },500)
    }
    render(){
        return (
           <this.onload />
        )
    }
}
export default ImageLazyLoad;
